<html>
    <head>
        <title>Printing an array</title>
        <style>
            div{
                padding:5px;
            }
        </style>
    </head>
    <body>
        <div><h4>Printing an array using "for of" loop</h4></div>
        <div>Check console for output..</div>
    </body>
</html>
<script>
    var inputArray=[33,44,11,33,44,555,11,11,45];
    
    console.log("Given Array: ");
    console.log(inputArray);
    console.log("Array printed using for of loop: ")
    
    for(let i of inputArray){
        console.log(i);
    }
    
</script>
